prediction.sparql:
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?series ?seriesLabel ( AVG( ?rating ) AS ?avgEpisodeRating ) ( COUNT( ?episode ) AS ?numEpisodes ) WHERE {
  ?episode imdb:titleType "tvEpisode" ; imdb:parentTitle ?series ; imdb:averageRating ?rating ; imdb:numVotes ?votes .
  FILTER ( ?votes >= 10000 ) ?series imdb:titleType "tvSeries" .
  OPTIONAL {
    ?series rdfs:label ?seriesLabel
  }
}
GROUP BY ?series ?seriesLabel
HAVING ( COUNT( ?episode ) >= 20 )
ORDER BY DESC ( ?avgEpisodeRating )
LIMIT 10

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
PREFIX imdb_principal: <https://www.imdb.com/principal/>
SELECT DISTINCT ?person ?personLabel ?title1 ?title1Label ?title2 ?title2Label WHERE {
  ?title1 imdb_principal:actor ?person .
  ?title2 imdb_principal:director ?person .
  FILTER ( ?title1 != ?title2 ) ?title1 imdb:numVotes ?votes1 .
  ?title2 imdb:numVotes ?votes2 .
  FILTER ( ?votes1 > 100000 && ?votes2 > 100000 ) OPTIONAL {
    ?person rdfs:label ?personLabel
  }
  OPTIONAL {
    ?title1 imdb:primaryTitle ?title1Label
  }
  OPTIONAL {
    ?title2 imdb:primaryTitle ?title2Label
  }
}
LIMIT 100

PREFIX imdb: <https://www.imdb.com/>
SELECT ?person WHERE {
  ?person imdb:profession ?prof .
  FILTER ( ?prof = "actor" || ?prof = "actress" ) ?person imdb:knownForTitle ?title .
  ?title imdb:isAdult ?isAdult .
  OPTIONAL {
    ?title imdb:numVotes ?numVotes .
  }
  FILTER ( ?isAdult = true || ( ?isAdult = false && ?numVotes >= 100000 ) )
}
GROUP BY ?person
HAVING ( SUM( IF( ?isAdult = true , 1 , 0 ) ) >= 3 && SUM( IF( ?isAdult = false && ?numVotes >= 100000 , 1 , 0 ) ) >= 1 )
LIMIT 10

PREFIX imdb: <https://www.imdb.com/>
PREFIX imdb_principal: <https://www.imdb.com/principal/>
SELECT ?movie ?actor ?birthYear ?startYear ( ( ?startYear - ?birthYear ) AS ?ageAtRelease ) WHERE {
  ?movie imdb:titleType "movie" .
  ?movie imdb:numVotes ?votes .
  FILTER ( ?votes >= 100000 ) OPTIONAL {
    ?movie imdb_principal:actor ?actor .
  }
  OPTIONAL {
    ?movie imdb_principal:actress ?actor .
  }
  ?actor imdb:birthYear ?birthYear .
  ?movie imdb:startYear ?startYear .
  FILTER ( ?startYear >= ?birthYear )
}
ORDER BY DESC ( ?ageAtRelease )
LIMIT 100

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?series ?seriesLabel ( MAX( ?runtime ) - MIN( ?runtime ) AS ?runtimeDiff ) WHERE {
  ?series imdb:titleType "tvSeries" ; imdb:numVotes ?votes .
  FILTER ( ?votes > 100000 ) OPTIONAL {
    ?series rdfs:label ?seriesLabel
  }
  ?episode imdb:parentTitle ?series ; imdb:runtimeMinutes ?runtime .
}
GROUP BY ?series ?seriesLabel
ORDER BY DESC ( ?runtimeDiff )
LIMIT 10

PREFIX imdb: <https://www.imdb.com/>
PREFIX imdb_principal: <https://www.imdb.com/principal/>
SELECT ?actor ?director ( COUNT( * ) AS ?collaborations ) WHERE {
  ?movie imdb:titleType "movie" .
  ?movie imdb:numVotes ?votes .
  FILTER ( ?votes >= 100000 ) ?movie imdb_principal:director ?director .
  ?movie imdb_principal:actor ?actorAll .
  {
    SELECT ?movie ( MIN( ?actorX ) AS ?actor ) WHERE {
      ?movie imdb_principal:actor ?actorX .
    }
    GROUP BY ?movie
  }
  FILTER ( ?actor = ?actorAll )
}
GROUP BY ?actor ?director
HAVING ( ?collaborations >= 5 )
ORDER BY DESC ( ?collaborations )
LIMIT 10

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?movie ?director ?releaseYear ?birthYear ( ?releaseYear - ?birthYear AS ?ageAtRelease ) ?movieLabel ?directorLabel WHERE {
  ?movie rdf:type imdb:Movie .
  ?movie imdb:numVotes ?votes .
  FILTER ( ?votes >= 100000 ) .
  ?movie imdb:director ?director .
  ?movie imdb:startYear ?releaseYear .
  ?director imdb:birthYear ?birthYear .
  OPTIONAL {
    ?movie rdfs:label ?movieLabel
  }
  OPTIONAL {
    ?director rdfs:label ?directorLabel
  }
  FILTER ( ?releaseYear >= ?birthYear ) .
}
ORDER BY DESC ( ?ageAtRelease )
LIMIT 100

PREFIX imdb_title: <https://www.imdb.com/title/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX imdb: <https://www.imdb.com/>
SELECT ?episode ?rating ?label WHERE {
  ?episode imdb:parentTitle imdb_title:tt0903747 .
  ?episode imdb:seasonNumber 5 .
  ?episode imdb:averageRating ?rating .
  OPTIONAL {
    ?episode rdfs:label ?label
  }
}
ORDER BY DESC ( ?rating )
LIMIT 3
